import React from 'react'
import styles from '../css/shop.module.css'


const Shop = () => {
    return (
        <div>
            <div className={styles.head}>
                <h1>Products</h1>
                <p>Explore a wide range of products from our store.</p>
            </div>
        </div>
    )
}

export default Shop
